import React from "react";
import "../styles/JourneyCard.css";

const JourneyCard = ({ journey }) => {
  return (
    <div className="journey-card">
      <img src={"../img/Alps.jpeg"} alt={journey.title} />
      <h2>{journey.title}</h2>
      <p>{journey.description}</p>
    </div>
  );
};

export default JourneyCard;
